import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  blockChaussure: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    overflow: 'auto',
    width: '450px',
    height: '400px',
    backgroundColor: 'rgba(0,0,0,0.15)',
    padding: '0.5rem',
    margin: '0.5rem',
  },
  imgChaussure: {
    width: '400px',
    height: '300px',
  },
  blockBlanc: {
    width: '450px',
    backgroundColor: 'red',
    borderRadiusTop: '20px',
    padding: '0.75rem',
    marginTop: '-25px',
  }
});
